import { createBrowserRouter, RouterProvider } from "react-router-dom";
import Layout from "./components/Layout.jsx/Layout";
import Register from "./components/Register/Register";
import Signin from "./components/Signin/Signin";
import Home from "./components/Home/Home";
import Upcoming from "./components/TopComingGames/Upcoming";
import GameDetails from "./components/GameDetails/GameDetails";
import Filter from "./components/Filter/Filter";
import MainHome from "./components/MainHome/MainHome";
import Tags from "./components/Tags/Tags";
import UserContextProvider from "./components/Store/UserContextStore";
import 'font-awesome/css/font-awesome.min.css';

function App() {
  const Routing = createBrowserRouter([  
  {path:'Register',element: <Register/>},
  {path:'Signin',element: <Signin/>},
  {path:'/',element: <Layout/>,children:[
    {path:'/home',element: <Home/>,children:[
      {index:true,element: <MainHome/>},
      {path:'/home/Utags/:filter',element: <Filter/>},
      {path:'/home/Tags/:filter',element:<Tags/>},
    ]},
    {path:'/Upcoming',element: <Upcoming/>},
    {path:'/GameDetails/:id',element: <GameDetails/>}
  ]}
])

  return (
    <UserContextProvider>
    <RouterProvider router={Routing}>
    </RouterProvider>
    </UserContextProvider>
  );
}

export default App;
